import React from 'react'
import {Typography,AppBar,Button,Card,CardContent,CardMedia,CssBaseline,Grid,Toolbar,Container, CardActions} from '@material-ui/core'


const OfferScreen = () => {
    return (
        <>
          <ButtonGroup size="large" color="primary" aria-label="large outlined primary button group">
           <Button>One</Button>
           <Button>Two</Button>
          </ButtonGroup> 
        </>
    )
}

export default OfferScreen
